                include);
            ret.Uses = item.Uses == rhs.Uses;
            ret.Value = item.Value == rhs.Value;
            ret.Weight = item.Weight.EqualsWithin(rhs.Weight);
            ret.DATADataTypeState = item.DATADataTypeState == rhs.DATADataTypeState;
